import { Component} from "react";
import Square from './Square'
class Board extends Component{
  constructor(props) {
    super(props);

  }
  render(){
    let squareAll = []
    for(let i=0; i<3; i++){
      let squareRow = []
      for(let j=0;j<3;j++){
        squareRow.push(<Square value={j} key={j}></Square>)
      }
      squareAll.push( <div>{squareRow}</div> )
    }
    return (
      <div>
        <p>next player is A</p>
        <div>
          {          squareAll
          }
        </div>
      </div>
    )
  }
}
export default Board
